import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import "../App.css"
import NavLink from './Navbar';
import emailjs from '@emailjs/browser';
import thumbUp from '../assets/thumb-up.png';

function Reviewme() {
    const [email, setEmail] = useState('');
    const [firstName, setFirstName] = useState('');
    const [lastName, setLastName] = useState('');
    const [googleLink, setGoogleLInk] = useState('Please find the links for Google');
    const [facebookLink, setFacebookLink] = useState('Please find the link for Facebook');

    const navigate = useNavigate();

    const handleSubmit = (e) => {
        e.preventDefault();
        const serviceId = 'service_rkliftr';
        const templateId = 'template_j5123dj';
        const publicKey = 'uaevzCuvbpVxUlj4Y';

        const templateParams = {
            to_name: firstName + ' ' + lastName,
            to_email: email,
            from_name: "ReviewMe KPT",
            reply_to: "info@karakafamilyhealth.com",
            googleLink: googleLink,
            facebookLink: facebookLink,

        }

        emailjs.send(serviceId, templateId, templateParams, publicKey)
            .then((response) => {
                console.log('Email sent successfully!', response);
                setEmail('');
                setFirstName('');
                setLastName('');
            })
            .catch((error) => {
                console.error('Error sending email', error);
            });

    }
    return (
        <div className='d-flex flex-column align-items-center bgSecondary ' style={{ height: "100vh" }}>
            <NavLink />
            <div className=' d-flex flex-column justify-content-start align-items-center w-100 bgPrimary rounded-bottom-5 dropShadow' style={{ height: "80vh" }}>
                <div className=' d-flex flex-column justify-content-start align-items-center border border-danger w-50 ' style={{ height: "90%" }}>
                    <div className=' d-none flex-column justify-content-evenly align-items-center border border-success' style={{ height: "20%" }}>
                        <div className=''>
                            ReviewMe
                        </div>
                        <form onSubmit={handleSubmit} className='emailForm'>
                            <input
                                type='text'
                                placeholder='Your First Name'
                                value={firstName}
                                onChange={(e) => setFirstName(e.target.value)}
                            />
                            <input
                                type='text'
                                placeholder='Your Last Name'
                                value={lastName}
                                onChange={(e) => setLastName(e.target.value)}
                            />
                            <input
                                type='email'
                                placeholder='Your email'
                                value={email}
                                onChange={(e) => setEmail(e.target.value)}
                            />
                            <button type='submit'>Send Email</button>

                        </form>
                    </div>
                    <dv className='w-100 ps-5 border border-success mt-4 mb-4'>
                        <h1 >Share What's on Your Mind</h1>
                        <h5 className='textSecondary'>We Value Your Voice!</h5>
                    </dv>
                    <div className=' d-flex flex-column justify-content-center align-items-center w-100 border border-success ' style={{ height: "100%" }}>
                        <div className='blockSection bgBlock d-flex flex-column justify-content-between align-items-center pt-5 pb-5'>
                            <div className=''>
                                <h2 className='textMain'>Excellent! Please Rate us 5-stars</h2>
                                <h5 className='textSecondary'>...and leave a helpful review.</h5>
                            </div>
                            <div>
                                <button className='happyButton align-items-center' onClick={() => navigate('/reviewme')}> ReviewMe   <img src={thumbUp} style={{ height: '30px' }} alt="thumb Up" /></button>
                                <button className='happyButton align-items-center' onClick={() => navigate('/reviewme')}> ReviewMe   <img src={thumbUp} style={{ height: '30px' }} alt="thumb Up" /></button>
                            </div>

                        </div>
                    </div>
                </div >
            </div>


        </div >
    )
}

export default Reviewme
